import React from "react";

import Header from "../Components/Header";
import Footer from "../Components/Footer";

import classes from "./Petove.module.css";

const Petove = () => {
  return (
    <div className={classes.wrap}>
      <Header bgColor=" " titleColor="#666666" />

      <SiteButton
        className={classes.composeBtn}
        btnColor="#e35c5b"
        textColor="#ffffff"
        top="775px"
        left="370px"
        link="smoothieking/index.html"
      />

      <SiteButton
        className={classes.composeBtn}
        btnColor="#e35c5b"
        textColor="#ffffff"
        width="452px"
        top="7110px"
        left="50%"
        link="smoothieking/index.html"
        transX="-50%"
      />

      <Footer footerTop="7250px" />
      <img src="images/smoothie_king.png" alt="스무디킹" />
    </div>
  );
};

export default Petove;
